import Header from './components/Header';
import Nav from './components/Nav';
import Avatar from './components/Avatar';
import Profileform from './components/Profileform';


const Profile = () =>{
    return (
        <div className="profile">
            <Header/>
            <Nav/>
            <Avatar/>
            <Profileform/>
        </div>
    );
};

export default Profile;
